import React from 'react';
import '../style.css'

export default class AboutMeView extends React.Component {
    render() {
        return (
            <div>
                <img className="profile" src="../../../public/profile.png" alt="Sarah Martin"></img>
                <div style="left: 100px;">ABOUT ME PAGE</div>
            </div>
        );
    }
}
